contracts/SampleContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract SampleContract {
    using SafeMath for uint;

    mapping(address => uint) public balanceOf;
    mapping(address => bool) public frozenAccount;
    mapping(address => uint) public unlockUnixTime;

    event Transfer(address indexed from, address indexed to, uint value);
    event TransferWithData(address indexed from, address indexed to, uint value, bytes data);

    constructor() {
        // Initialize balances or other state variables if needed
    }

    function transferToAddress(address _to, uint _value, bytes memory _data) internal returns (bool success) {
        require(balanceOf[msg.sender] >= _value);
        balanceOf[msg.sender] = balanceOf[msg.sender].sub(_value);
        balanceOf[_to] = balanceOf[_to].add(_value);
        emit Transfer(msg.sender, _to, _value);
        emit TransferWithData(msg.sender, _to, _value, _data);
        return true;
    }

    function isContract(address _addr) internal view returns (bool) {
        uint size;
        assembly {
            size := extcodesize(_addr)
        }
        return size > 0;
    }

    /**
     * @dev Function that is called when a user or another contract wants to transfer funds
     */
    function transfer(address _to, uint _value, bytes memory _data, string memory _custom_fallback) public returns (bool success) {
        require(_value > 0
                && frozenAccount[msg.sender] == false
                && frozenAccount[_to] == false
                && block.timestamp > unlockUnixTime[msg.sender]
                && block.timestamp > unlockUnixTime[_to]);

        if (isContract(_to)) {
            require(balanceOf[msg.sender] >= _value);
            balanceOf[msg.sender] = balanceOf[msg.sender].sub(_value);
            balanceOf[_to] = balanceOf[_to].add(_value);
            (bool result, ) = _to.call(abi.encodeWithSignature(_custom_fallback, msg.sender, _value, _data));
            require(result);
            emit Transfer(msg.sender, _to, _value);
            emit TransferWithData(msg.sender, _to, _value, _data);
            return true;
        } else {
            return transferToAddress(_to, _value, _data);
        }
    }

    // Additional functions to manage frozen accounts and unlock times
    function freezeAccount(address _addr, bool _freeze) public {
        frozenAccount[_addr] = _freeze;
    }

    function setUnlockTime(address _addr, uint _unlockUnixTime) public {
        unlockUnixTime[_addr] = _unlockUnixTime;
    }
}

